import './Toolbar.css';

const SideMenu = () => {
  return (
    <>
    <div>
      <div className="toolbar-left"></div>
      <div className='fd-clearbox'>
        <div className="header">
        <a href="#top" className="title">
          <label>
            Toolbar
          </label>
        </a>
        </div>
        <ul className='list-toolbar'>
          <li>

          </li>
        </ul>
      </div>
      </div>
    </>
  );
};

export default SideMenu;
